import React from 'react';

class OtherWeatherData extends React.Component {
  render() {
    if(this.props.data.main) {
      return(
        <div className="otherWeatherData">
          <div className="windSpeed">
            <h2>{this.props.data.wind.speed}</h2>
          </div>
          <div className="left_block">
            <h2>{this.props.data.visibility}</h2>
            <p>Visibility</p>
            <br/>
            <h2>{this.props.data.main.pressure}</h2>
            <p>Pressure</p>
          </div>
          <div className="right_block">
            <h2>{this.props.data.main.humidity}</h2>
            <p>Humidity</p>
            <br/>
            <h2>{this.props.data.sys.sunrise}</h2>
            <p>Sunrise</p>
          </div>
        </div>
      );
    } else return null;
  }
}

export default OtherWeatherData;
